import React from "react";



export default function Home() {

    const [contador, setContador] = React.useState(0);

    const onChange = () => {
        return setContador++
    }

    return (
        <div>
            <div>
            <h1>Pokemons</h1>
            </div>
            <div>
                <button onClick={onChange}></button>
                <span>{'yo soy contador ' + contador}</span>
            </div>

        </div>
    )
}
